   // Sending ClientId to Shutterstock iframes
   var clientId = undefined;
   var iframeQueue = [];

   function sendClientId()
   {
       while (iframeQueue.length>0)
       {
           var iframe = iframeQueue.pop();
           // Extract domain from iframe src
           var parser = document.createElement('a');
           parser.href = iframe.src;
           var target = parser.protocol+'//'+parser.hostname;
           iframe.contentWindow.postMessage(clientId, target);
       }
   }
   function askForClientId(element)
   {
       iframeQueue.push(element);
       if (clientId)
       {
           sendClientId();
       }
   }

   ga(function (tracker) {
       clientId = tracker.get('clientId');
       sendClientId();
   });

   if (window.performance && document.addEventListener && window.addEventListener) {
       document.addEventListener('DOMContentLoaded', function () {
           ga('send', 'timing', 'performance', 'DOMContentLoaded', Math.round(performance.now()) /* TODO: 'Highwinds CDN' | 'Edgecast CDN' | 'OVH' */);
       });
   }

   function ga_logged_in_callback(data) {
       var userType = !data.status ? 'guest' : (data.premium ? 'premium' : 'registered');
       ga('set', 'dimension1', userType);
       if (data.id) {
           ga('set', 'userId', data.id);
       }
   }

   function logged_in_callback(data) {
       ga_logged_in_callback(data);
   }

form.script:
var search_type;
try {
    search_type = localStorage.getItem("search-type");
} catch (e) {
    search_type = 'icons';
}

if (search_type)
{
    document.querySelector(".search-holder .type-selector input[name=search-type][value='"+search_type+"']").checked = true;
    document.querySelector(".search-holder .type-selector .popover-button").innerHTML = search_type.charAt(0).toUpperCase() + search_type.slice(1);
}
if (window.location.pathname == '/packs' || window.location.pathname.search('icon-packs') != -1) {
    document.querySelector(".search-holder .type-selector .popover-button").innerHTML = "Packs";
    document.querySelector(".search-holder .type-selector input[name=search-type][value='packs']").checked = true;
}

section.script:
var DEFAULT_AVATAR = 'https://image.flaticon.com/img/default_avatar.png';
function set_default_avatar(elem)
{
    elem.src = DEFAULT_AVATAR;
}

var pageview;
try {
    pageview = parseInt(localStorage.pageview || 0, 10)
} catch(e) {
    pageview = 1;
}

if (pageview < 3){
    var login_link = document.getElementById("gr_not-connected");
    login_link.classList.add("dropdown-active");
    try {
        localStorage.pageview = pageview + 1;
    } catch(e) {}

    setTimeout(function() {
        var login_link = document.getElementById("gr_not-connected");
        if (login_link) {
            login_link.classList.remove('dropdown-active');
        }
    }, 4000);
}

