    var isMobileAgent = (/android|webos|iphone|ipad|ipod|blackberry|iemobile|opera mini/i.test(userAgent));
    var isNarrowScreen = (window.innerWidth <= 768 && window.innerHeight <= 600);
    var isMobile =  isMobileAgent || isNarrowScreen;

    if (!cookie_gr_welcome) {
        launch_campaing_popups();
    } else {
        var cookie_data = JSON.parse(decodeURIComponent(cookie_gr_welcome));
        var isValidSite = ['flaticon','freepik'].indexOf(cookie_data.site)!=-1;
        var isValidDate = (new Date(cookie_data.date).getTime()) > (new Date(new Date().getTime() - (24*60*60*1000)));

        if (!isValidSite || !isValidDate) {
            launch_campaing_popups();
        }
    }

    function launch_campaing_popups() {
        /**
         * Popup
         */
        try {
            var popups = Array.prototype.slice.call(document.getElementsByClassName('popups'));

            popups.forEach(function(popup) {
                var popupModalClose = popup.querySelector('.modal__close');
                var popupModalInterval;
                var popupCount = parseFloat(Cookie.get(popup.id + '_count') || '0');
                var popupLink = popup.querySelector('a');
                var popupMax = parseFloat(popup.getAttribute('data-max'));
                var currentDate = new Date();
                var startDate = new Date(popup.getAttribute('data-start'));
                var endDate = new Date(popup.getAttribute('data-end'));

                /**
                 * Events
                 */
                var eventLoad = popup.dataset.onload;
                var eventOpen = popup.dataset.open;
                var eventClose = popup.dataset.close;

                if ( (!Cookie.get(popup.id)) &&
                    (popup) &&
                    (popupLink) &&
                    (popupModalClose) &&
                    (currentDate.getTime() >= startDate.getTime() && currentDate.getTime() <= endDate.getTime()) &&
                    ('undefined' !== typeof gr &&
                    !gr.auth.me.premium) &&
                    (!popupMax || popupCount < popupMax) &&
                    (eventLoad && eventOpen && eventClose) ) {

                    if (isMobile) {
                        popup.find(".popup-mobile").removeClass('hidden');
                        popup.find(".popup-web").addClass('hidden');
                    }

                    $(popup).addClass('show');

                    document.querySelector('body').classList.add('blur');

                    if (popup.id.match(/wintersale/gi)) {
                        setTimeout(function() { $(popup).addClass('scene-animate-1') }, 1000);
                        setTimeout(function() { $(popup).addClass('scene-animate-2') }, 1800);
                        setTimeout(function() { $(popup).addClass('scene-animate-3') }, 2400);
                    }

                    if (popup.id.match(/valentine/gi)) {
                        valentineContainer = $(popup).find('.valentine')
